'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocBrief("The command for getting all instruments available for the user")
class GetAllInstrumentsCommand extends SendSingleCommandWithoutResponse {
    offerIds;
    requestNumber;
    constructor() {
        super();
        this.commandName = "GetAllInstrumentsCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetAllInstrumentsRequestMessage(this.offerIds, this.tradingSession, this.requestNumber, stdlib.nowutc());
    }
}
module.exports = GetAllInstrumentsCommand
